import React from 'react';
import styled from 'styled-components';

import Card from '../Card/Card';

const RandomRecipe = styled.div`
	display: flex;
	justify-content: center;
	margin: 2rem;
`;

const axios = require('axios');

const options = {
	method: 'GET',
	url: 'https://spoonacular-recipe-food-nutrition-v1.p.rapidapi.com/recipes/random',
	params: { number: '3' },
	headers: {
		'X-RapidAPI-Key': '2ad55f65fbmshcfe0e39bda9c68bp12a597jsn89ff591ad860',
		'X-RapidAPI-Host': 'spoonacular-recipe-food-nutrition-v1.p.rapidapi.com',
	},
};

const recipe = {};

axios
	.request(options)
	.then(function (response) {
		// console.log(response.data.recipes[0].title);
		response.data.recipes.map(recipe => {
			recipe = {
				title: recipe.title,
			};
		});
	})
	.catch(function (error) {
		console.error(error);
	});

function RandomRecipes() {
	return (
		<RandomRecipe className='card-containers'>
			<Card />
			<Card />
			<Card />
		</RandomRecipe>
	);
}

export default RandomRecipes;
